$_MODULE['<{paytpv}prestashop>paytpv-account_d009bf54f459a2a9c1e516ae765ab0fd'] = 'PAYTPV tiek veikts arī ikgadējs audits, atbilstoši maksājumu kartes datu drošības sektoram (PCI DSS), kas ir pilnībā apstiprināts 1.līmeņa (augstākais līmenis) maksājumu pakalpojumu sniedzējs.';
