$_MODULE['<{paytpv}prestashop>paytpv-account_597e7dad679311f7eb5758b495e2124c'] = 'PAYTPV ir vairākas privātas saites ar banku tīkliem, kas ir pilnībā neatkarīgas no Interneta un nepiesaista nevienu publiskas pieejas tīklu. Visa īpašnieka bankai nosūtītā informācija un visi autorizācijas paziņojumi, kas nosūtīti kā atbilde, tiek aizsargāti un tos nav iespējams manipulēt.';
$_MODULE['<{paytpv}prestashop>paytpv-account_0ae902925f2cf9350aac524f5eb4cf95'] = 'Iekšējā drošība';
$_MODULE['<{paytpv}prestashop>paytpv-account_2bf0c149d1690aa41a2179a597588b69'] = 'PAYTPV ir pārbaudīta kontrole radīšanas vides piekļuvei. CPD, kur paliek sistēmas, darbojas saskaņā ar prasībām Tier III centriem. Tādējādi garantē, ka drošība netiek apdraudēta nevienā brīdī. Pieejamas izsmalcinātas brīdinājuma sistēmas, uzraudzība, izmantojot slēgtus TV lokus, un drošības uzraugi instalācijās ir pieejami 24 stundas diennaktī 7 dienas nedēļā, tādējādi īstenojot stingru uzraudzību un nepārtrauktu apkalpošanu. Visa transkaciju un klienta karšu informācija tiek aizsargāta, tai skaitā, izmantojot mūsu personīgos darbiniekus.';
